import React, { Component } from "react";
import PageHelmet from "../component/common/Helmet";
import ModalVideo from "react-modal-video";
import {
  FaTwitter,
  FaInstagram,
  FaFacebookF,
  FaLinkedinIn,
} from "react-icons/fa";
import ScrollToTop from "react-scroll-up";
import { FiChevronUp } from "react-icons/fi";
import Header from "../component/header/Header";
import Footer from "../component/footer/Footer";
import { useHistory } from "react-router-dom";
import FooterTwo from "../component/footer/FooterTwo";

const SocialShare = [
  { Social: <FaFacebookF />, link: "https://www.facebook.com/" },
  { Social: <FaLinkedinIn />, link: "https://www.linkedin.com/" },
  { Social: <FaInstagram />, link: "https://www.instagram.com/" },
  { Social: <FaTwitter />, link: "https://twitter.com/" },
];

const project = [
  {
    role: "Senior Frontend Developer",
    company: " Lariat Data Inc.",
    website: "https://lariatdata.com",
    description: (
      <ul>
        <li>
          Created highly performant dashboards and debugging tools to help track
          and improve data quality for data and ML pipelines.
        </li>
        <li>
          Redesigned the entire UI using new Figma designs that consist of
          graphs, charts, data tables, and various other components. Added unit
          tests, formatting, and lining tools.
        </li>
        <li>
          Architected re-usable patterns to use D3.js within the React
          framework.Performed componentization of data visualizations for use in
          other parts of the company.
        </li>
      </ul>
    ),
  },
];
class PortfolioDetails extends Component {
  constructor() {
    super();
    this.state = {
      isOpen: false,
    };
    this.openModal = this.openModal.bind(this);
    this.getPortfolioDetails = this.getPortfolioDetails.bind(this);
  }
  openModal() {
    this.setState({ isOpen: true });
  }

  getPortfolioDetails = () => {
    const pathName = window.location.pathname;

    if (pathName) {
      const pathArray = pathName.split("/")[2];
      switch (pathArray) {
        case "sass-product":
          return 0;
        case "customer-portal":
          return 1;
        case "mvp-food-industry":
          return 2;
        case "emission-dashboard":
          return 3;
        case "elderly-app":
          return 4;
        case "training-tool":
          return 5;
        default:
          return 5;
      }
    }
  };

  render() {
    const portfolioDetails = this.getPortfolioDetails();
    return (
      <React.Fragment>
        <PageHelmet pageTitle="Portfolio Details" />

        {/* Start Portfolio Details */}
        <div
          className="rn-portfolio-details ptb--120"
          style={{ background: "#191919" }}
        >
          <div className="container">
            <div className="row">
              <div className="col-lg-12">
                <div className="portfolio-details">
                  <div className="inner">
                    <div className="single-tab-content">
                      <ul>
                        <li>
                          <div
                            class="d-flex flex-row"
                            style={{ marginBottom: 12 }}
                          >
                            <div
                              class="font-weight-bold w-25"
                              style={{ marginRight: 12 }}
                            >
                              Role:{" "}
                            </div>
                            <div class="w-75"> {project[0]['role']}</div>
                          </div>
                          <div
                            class="d-flex flex-row"
                            style={{ marginBottom: 12 }}
                          >
                            <div
                              class="font-weight-bold w-25"
                              style={{ marginRight: 12 }}
                            >
                              Company:{" "}
                            </div>
                            <div class="w-75"> {project[0]['company']}</div>
                          </div>
                          <div
                            class="d-flex flex-row"
                            style={{ marginBottom: 12 }}
                          >
                            <div
                              class="font-weight-bold w-25"
                              style={{ marginRight: 12 }}
                            >
                              Company Website:{" "}
                            </div>
                            <a href={prohect[0]['cwebsite']}>
                              {" "}
                              
                            </a>
                          </div>
                          <div
                            class="d-flex flex-row"
                            style={{ marginBottom: 12 }}
                          >
                            <div
                              class="font-weight-bold w-25"
                              style={{ marginRight: 12 }}
                            >
                              Tech:{" "}
                            </div>
                            <div class="w-75">
                              {" "}
                              React , Redux , CSS , Redux Saga , D3.js ,
                              Tailwind CSS , MUI-Data-Table , Lodash and Charts
                            </div>
                          </div>
                          <div
                            class="d-flex flex-row"
                            style={{ marginBottom: 12 }}
                          >
                            <div
                              class="font-weight-bold w-25"
                              style={{ marginRight: 12 }}
                            >
                              Description :{" "}
                            </div>
                            <div class="w-75">
                              <ul>
                                <li>
                                  Created highly performant dashboards and
                                  debugging tools to help track and improve data
                                  quality for data and ML pipelines.
                                </li>
                                <li>
                                  Redesigned the entire UI using new Figma
                                  designs that consist of graphs, charts, data
                                  tables, and various other components. Added
                                  unit tests, formatting, and lining tools.
                                </li>
                                <li>
                                  Architected re-usable patterns to use D3.js
                                  within the React framework.Performed
                                  componentization of data visualizations for
                                  use in other parts of the company.
                                </li>
                              </ul>
                            </div>
                          </div>
                        </li>
                      </ul>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
        {/* End Portfolio Details */}

        <FooterTwo />
      </React.Fragment>
    );
  }
}
export default PortfolioDetails;
